# Comparamos cuando YPF rindió mejor que MIRGOR

def comparativa(row):    

    highlight = 'background-color: green;'
    default = ''

    # must return one string per cell in this row
    if row['YPF'] > row['MIRG.BA']:
        return [highlight, default]
    else:
        return [default, default]

